import React, { Component } from 'react';
import Grid from '@material-ui/core/Grid'
import { stepCompleted, taskCompleted } from "../redux/actions"
import { useDispatch, useSelector } from "react-redux"
import taskCompletion from "./taskCompletion"
import "../App.css"



const TodoSubList = ({ propsParent, props }) => {
    const dispatch = useDispatch()
    console.log("props", props)


    if (Object.keys(props).length >= 1) {
        let container =
            Object.keys(props).map(input =>

                <div className='container'>
                    {console.log("propsStep", props[input].step)}

                    <div className="subitem1-container ">
                        {props[input].step}
                    </div>
                    <div className="subitem1-container ">
                        Date
                </div>
                    <div className="subitem1-container ">
                        <div className="filler" style={{ width: `${props[input].completed * 100}%` }}>
                        </div>
                    </div>

                    <div className="subitem1-container ">
                        {props[input].completed ?
                            <button type="submit" onClick={() => dispatch(stepCompleted(propsParent, props[input], taskCompletion(propsParent, props)))}>Undo</button>

                            :
                            <button type="submit" onClick={() => dispatch(stepCompleted(propsParent, props[input], taskCompletion(propsParent, props)))}>completed</button>

                        }

                    </div>

                </div>
            )
        console.log("returning")
        return container
    }
    return null
}



export default TodoSubList;
